function api(){
    fetch("https://type.fit/api/quotes")
    .then(function(response){
        return response.json
    }).then(function(data){
        return console.log(data)
    })
}


export default function Quote(){
    return (
        fetch("https://type.fit/api/quotes")
            .then(function(response){
                return response.json
            })
            .then(function(data){
                <div>data</div>
            })
    );
}
